import React from "react";
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const StyledDiv = styled.div
`
float:right;
padding: 0 2% 0 0;
`

const LINKS = [
  { to: '/', text: 'Home'},
  { to: '/settings', text: 'Settings'},
]

const Nav = () => {
  return (
    <StyledDiv>
      <ul>
        {
          LINKS.map(item => (
            <li key={item.to}><Link to={item.to}>{item.text}</Link>
            </li>
          ))}
      </ul>
    </StyledDiv>
  )
}

export default Nav;
